pragma solidity ^0.8.12;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Token is ERC20 {
    address payable owner;
    uint8 tokenDiscountValue; // 1 token = 1% discount

    constructor(address payable _owner,string memory _tokenName,string memory _tokenSymbol) ERC20(_tokenName,_tokenSymbol) {
        owner = _owner;
        _mint(owner,1000*10**18);
    }

    modifier onlyOwner {
        require(owner == msg.sender,"Only owner allowed");
        _;
    }

    function transfer(address _to, uint256 _value) public virtual override onlyOwner returns(bool) {
        return super.transfer(_to,_value);
    }
    function transferFrom(address _from, uint256 _value) public returns(bool) {
        return super.transferFrom(_from,address(this),_value);
    }
    function setDiscountValue(uint8 _tokenDiscountValue) public onlyOwner{
        tokenDiscountValue = _tokenDiscountValue;
    }
    function getDiscountValue() public view returns (uint8) {
        return tokenDiscountValue;
    }
}","keccak256":"0x4f1b922fd98c6aac8fa3c3243b49eefab1b2a98926c6de0027ff8a344c283582","license":"SEE LICENSE IN LICENSE"},"contracts/TokenFactory.sol":{"content":"// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.12;

import './Token.sol';

contract TokenFactory {
    mapping (address => address) public userToToken;
    function deployToken(string memory _tokenName, string memory _tokenSymbol) public returns (address) {
        require(msg.sender != address(0),"Address 0 not allowed");
        Token token= new Token(payable(msg.sender),_tokenName, _tokenSymbol);
        userToToken[msg.sender]= address(token);
        return address(token);
    }
    function getTokenAddressOfUser() public view returns (address) {
        require(userToToken[msg.sender] != address(0),"User don't have any Token contract");
        return userToToken[msg.sender];
    }
}","keccak256":"0x600625ce73bdf2ffd3594098a86182e66ff754a7bfc9ab85e2f0634eb7233703","license":"SEE LICENSE IN LICENSE"}},"version":1}
